import { Component } from "react";

import "./Conversation.css"
import person from "./.././../../../../../../wwwroot/images/person.png";
import people from "./.././../../../../../../wwwroot/images/people_skin.png";

class Conversation extends Component {
    props:any = this.props

    render() {
        const {image, name, datetime, unreads, message, status, email, id} = this.props.data;
        return (
            <div className="conversation" key={`${email}${id}`}>
                <div className="image"><img src={people} title={name} alt={`${name}`} /></div>
                <div className = "description">
                    <div className="description-top">
                        <span className="destinator">{name}</span>
                        <span className="datetime">{datetime}</span>
                        <span className="unreads">{unreads}</span>
                    </div>
                    <div className="description-bottom">
                        <span className="message">{message}</span>
                        <span className="status">{status}</span>
                    </div>
                </div>
            </div>
        )
    }
}

export default Conversation
